import React ,{useEffect,useState} from "react";
import {Link,useParams,useHistory} from "react-router-dom";
import axios from "../../custom-axios/axios";

const UserProfile = ()=>{

    const[user,setUser] = useState({});
    const{userID} = useParams();

    useEffect(()=>{
        axios.get("/users/" + userID).then((data)=>{
            setUser(data.data);
        })
    });
    console.log(user);

    return(
        <section id="model-details">
            <div className="container">
                <div className="row">
                    <div className="col-12 col-md-5">
                        <div className="profile-block escort-bio">
                            <h3 className="profile-block-title font-alt">About my culture</h3>
                            <div id="bio-content" className="bio-container">
                                <p> Nam convallis sollicitudin convallis. In sed nisl in neque maximus interdum. Sed
                                    ultrices vulputate eros at fermentum. Vestibulum consequat commodo erat, id mollis
                                    nisi auctor eget. Phasellus viverra nibh vel augue pretium, sed
                                    pharetra felis suscipit. Integer rutrum urna eleifend orci blandit viverra. Aenean a
                                    fermentum felis.</p>
                            </div>
                        </div>
                    </div>
                    <div className="col-12 col-md-3">
                        <div className="profile-block">
                            <h3>Profile</h3>
                            <ul>
                                <li><span className="font-400">Name: </span><span
                                    className="profile-right">Allesandra</span></li>
                                <li><span className="font-400">Age: </span><span className="profile-right">24</span>
                                </li>
                                <li><span className="font-400">Height: </span><span
                                    className="profile-right">5&#39; 6</span></li>
                                <li><span className="font-400">Weight: </span><span
                                    className="profile-right">106lbs</span></li>
                                <li><span className="font-400">Hair: </span><span className="profile-right">Black</span>
                                </li>
                                <li><span className="font-400">Eyes: </span><span className="profile-right">Brown</span>
                                </li>
                                <li><span className="font-400">Stats: </span><span
                                    className="profile-right">34C-24-34</span></li>
                                <li><span className="font-400">Languages: </span><span
                                    className="profile-right">English</span></li>
                                <li><span className="font-400">Location: </span><span
                                    className="profile-right">London</span></li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    )
};


export default UserProfile;
